import React from "react";
import { Typography, styled, Box } from "@mui/material";

import hero from "../../assets/img/hero.svg";

// Styling component
const HeroImg = styled("div")({
  backgroundImage: `url(${hero})`,
  maxHeight: "720px",
});

const Home = () => {
  return <HeroImg></HeroImg>;
};

export default Home;
